import { IoIosSearch } from 'react-icons/io';
export default function SearchBox() {
    return(
        <div className='flex no-wrap h-8 w-1/4 border border-black m-5'>
            <IoIosSearch className='w-8 mx-auto'/>
            <input className='w-full outline-none' name='search' placeholder='search' />
        </div>
    )
}
